INSERT INTO `comentario` (`id`, `title`, `nombre`, `correo`, `comentario`, `web`, `logo`) VALUES
(4, 'Usabilidad', 'Mersi Mantilla', 'mersimantillaj@gmail.com', 'Es una aplicación muy fácil de usar', 'http://google.com', 'logo1.png'),
(5, 'Liquidador de Cirujías ', 'JAIRO MUÑOZ', 'ingjama@yahoo.es', 'Es una herramienta útil, novedosa y que en las entidades de salud en la región no disponen, optimiza el rendimiento de las actividades de las entidades, estandarizando los procedimientos y valores se pueden controlar los recursos económicos de las entidades, El software de este tipo, genera soluciones rápidas, este módulo puede ser implementado en los hospitales de las capitales, ya que no cuentan', 'http://google.com', 'logo1.png'),
(6, 'Multiplataforma', 'SANDRA ARANGO', 'ubicate192@hotmail.com', 'Excelente, Una aplicación multiplataforma que puede ser implementada en los diferentes centros hospitalarios y fácil de usar', 'http://google.com', 'logo1.png'),
(7, 'Escalabilidad', 'Edilson', 'edilsonlaverde_182@hotmail.com', 'Excelente aplicación nos ha cambiado los flujos de trabajo optimizando procesos', 'http://google.com', 'logo1.png'),
(8, 'buena herramienta', 'Fernando Torres', 'correocatfer@gmail.com', 'Excelente aplicación muy novedosa. felicitaciones.', 'http://google.com', 'logo1.png'),
(9, 'Verificar Anestesiologo Grupo 7', 'Sandra Olaya', 'samy.olarod@gmail.com', 'Muy buena aplicación, pero se deben vericar las unidades de liquidación para el anestesiologo del grupo 7. Aparece 7,13 cuando deberian ser 5,3 Ver artículo 48 manual tarifario SOAT', 'http://google.com', 'logo1.png'),
(26, 'Felicitaciones!', 'Oscar Ivan Rojas Barreto', 'oscar.rojas.barreto@outlook.com', 'Felicitaciones una aplicación web muy bien concebida.\r\n', 'http://google.com', 'logo1.png'),
(11, 'Stiven', 'stiven benavides', 'stiven02.0@gmail.com', 'La navegabilidad esta rápida y responde rápido a las operaciones, mi esposa es auditora medica mas tarde le digo que le de un visto bueno.', 'http://google.com', 'logo1.png'),
(25, 'Tiempos de respuesta', 'Oscar Ivan Rojas Barreto', 'oscar.rojas.barreto@outlook.com', 'Los tiempos de respuesta para las búsquedas son muy buenos. El diseño del formulario resulta coherente y bien resuelto. Muy fácil de utilizar para un usuario que emplee la aplicación por primera vez.', 'http://google.com', 'logo1.png'),
(17, 'comentario', 'luis mario', '', 'buen tiempo en las respuestas ', 'http://google.com', 'logo1.png'),
(18, 'Usabiliad', 'Hans Torres', 'hans82t@hotmail.com', 'Puedes mejorar en la usabilidad, comunicando al usuario la descripción del control, con el fin que la herramienta sea mas provechosa, creería que la funcionalidad cumple con el objetivo de tarificador, al ser sumas por cada cirugía, este derebia complementarse con un catálogos de descripción  ', 'http://google.com', 'logo1.png'),
(27, 'Respuesta Solicitud de Opinion', 'Asesoria y servicios AYC', 'asesoriayserviciosayc@gmail.com', 'Hace 4 semanas me escribiste solicitando nuestra opinion a tu aplicativo, me parece excelente la forma en la que lo aplicas aunque si tiene algunas cosas que se podrian mejorar, de hecho nosotros hemos estado muy interesados en crear proyectos de esta forma para nuestra ayuda en las capacitaciones ya que nosostros diseñamos aplicativos por access.. si gustas nos contactas y hablamos el tema.', 'http://google.com', 'logo1.png');
